$.a5m=function(){var u="18 Juni 2019 - Pukul 14:27",t="author_namalengkap",s=P.q
return P.f(["story_id","100","story_judul","Pantai Kartini","story_memo","Pernahkah kamu membayangkan penampakan kura-kura raksasa? Jika belum, cobalah mampir ke Pantai Kartini untuk melihatnya. Meski bukan kura-kura hidup, patung kura-kura raksana di pantai ini menjadi ikon favorit para wisatawan. Kura-kura Ocean Park ini juga merupakan wahana utama Pantai Kartini. Di sini, kamu bisa melihat akuarium yang berisi berbagai spesies laut, spa fish, serta teater.","story_tglposting","26 Maret 2019 - Pukul 21:13","story_urlphoto","https://1.bp.blogspot.com/-6QPCqQK3snQ/XSf5ByxyImI/AAAAAAAAYL0/SbTVx_-_VgEUV_ryxGtpNZtSKWiN_UaxgCLcBGAs/s1600/img_posting_20190712_001.jpg","story_isrejected","0","story_author_namalengkap","Setiawan Kusumo","story_author_urlphoto","https://scontent-sin6-2.cdninstagram.com/vp/ffa1c2b877796a61dbd7b450110d9590/5DC03E51/t51.2885-19/s150x150/58692065_817362908633675_5797632209472978944_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=111","data",H.e([P.f(["id","102","judul","Pantai Bandengan","memo","Jika ingin berkunjung ke pantai yang dipenuhi berbagai wahana permainan, Pantai Bandengan di Jalan Jepara Bangsri, Desa Bandengan bisa menjadi destinasi yang tepat. Untuk mengunjunginya, kamu bisa datang mulai pukul 08:00 hingga 17:00 dan menyiapkan biaya tiket masuk Rp5.000 per orang untuk hari biasa dan Rp7.000 per orang untuk hari libur.","tglposting",u,"urlphoto","https://1.bp.blogspot.com/-f6G7nl5QUGE/XSf5krxWGcI/AAAAAAAAYL8/27_L_yPmCvwEHf-aH5qDjP7RUH0Enrf0gCLcBGAs/s1600/img_posting_20190712_002.jpg","isrejected","0",t,"Dewi Kartini","author_urlphoto","https://scontent-sin6-2.cdninstagram.com/vp/77cecae03bdf82ead5b99cae4a199cad/5DBD1B60/t51.2885-19/s150x150/62416217_469089177173268_769609438809030656_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=100"],s,s),P.f(["id","103","judul","Pantai Teluk Awur","memo","Mengunjungi pantai akan semakin lengkap jika kamu melihat pesona matahari terbenamnya. Itu semua bisa kamu dapatkan di Pantai Teluk Awur. Pantai ini terletak di Jalan Teluk Awur, Kecamatan Tahunan. Sembari menunggu sunset, kamu bisa menikmati suasana pantai di beberapa kursi santai yang tersedia. Jika tak ingin kelewatan momen sunset, kamu perlu mencari spot terbaik. Pasalnya, pantai akan mulai padat menjelang sore hari.","tglposting",u,"urlphoto","https://1.bp.blogspot.com/-Ccvn3veCuLE/XSf6JGh96jI/AAAAAAAAYMI/TWVetoas4_IhGWKtfWy9la_F4kJXazuLQCLcBGAs/s1600/img_posting_20190712_003.jpg","isrejected","0",t,"Explore Vespa","author_urlphoto","https://scontent-sin6-2.cdninstagram.com/vp/a07bad4b67ccddaa32b9a4a833092367/5DA54843/t51.2885-19/s150x150/21042223_148330485756855_8012948260253597696_a.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=103"],s,s),P.f(["id","104","judul","Pantai Empu Rancak","memo","Pantai satu ini terletak di Desa Karanggodang, Mlonggo. Buka setiap hari, tempat wisata ini bisa kamu bisa kunjungi kapan saja. Mulanya, terdapat portal tempat penjualan tiket masuk, tetapi kini portal tersebut sudah tak difungsikan. Karena itu, kamu bisa bebas masuk secara gratis ke Pantai Empu Rancak.","tglposting","18 Juni 2019 - Pukul 14:28","urlphoto","https://1.bp.blogspot.com/-sDfF5xiE6iI/XSf6bdW55JI/AAAAAAAAYMQ/6e0pJpyKjfIQjCHxuopuulOCCeiP6ywFwCLcBGAs/s1600/img_posting_20190712_004.jpg","isrejected","0",t,"Aprilia Putri","author_urlphoto","https://scontent-sin6-2.cdninstagram.com/vp/3b8a55aea5b91ff5e38224241876a72b/5DAE1798/t51.2885-19/s150x150/59643663_822059424838121_538004169185820672_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=105"],s,s),P.f(["id","105","judul","Pantai Pungkruk","memo","Bagi pencinta kuliner seafood, Pantai Pungkruk adalah destinasi yang patut kamu pilih. Konon, pantai yang juga berada di Desa Mororejo, Mlonggo ini sempat menjadi pusat kafe dan karaoke. Namun, kini lokasi ini menjadi surganya kuliner tepi laut. Bagaimana tidak? Kamu bisa menemukan aneka hidangan olahan laut yang lezat di sini.","tglposting","18 Juni 2019 - Pukul 14:29","urlphoto","https://1.bp.blogspot.com/-wHsxaLHp67U/XSf6ubOOCVI/AAAAAAAAYMY/jtPV8uHOoFklAzr_bMJVIC8iKlaM3VTLwCLcBGAs/s1600/img_posting_20190712_005.jpg","isrejected","0",t,"Hafid Zun","author_urlphoto","https://scontent-sin6-2.cdninstagram.com/vp/1c52985dceade6c309bfab5ac01e010d/5DB775F2/t51.2885-19/s150x150/64634495_446380375919711_2906263515750727680_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=111"],s,s),P.f(["id","106","judul","Pantai Ombak Mati","memo","Di Desa Bondo, Kecamatan Bangsri, kamu akan menemukan pantai lain bernama Pantai Ombak Mati. Penamaan tersebut diambil dari kondisi area pantai yang memang jarang diterpa ombak, sehingga cukup aman untuk dikunjungi. Tak hanya itu, garis pantai ini juga hanya mencapai 2 km. Jadi, kamu bisa puas berkeliling ke setiap sudut pantai.","tglposting","18 Juni 2019 - Pukul 14:30","urlphoto","https://1.bp.blogspot.com/-AgeIEvln3Vg/XSf7DD1w7jI/AAAAAAAAYMg/p2x01Nuv5hILAPwi1Th1i4P5VLaYeGbDgCLcBGAs/s1600/img_posting_20190712_006.jpg","isrejected","0",t,"Nyong Kere","author_urlphoto","https://scontent-sin6-2.cdninstagram.com/vp/0ceda1b5ceb4de9b2a9a8e5d7eea9fe7/5DBED230/t51.2885-19/s150x150/60320140_2733532470018580_775749682969182208_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=104"],s,s),P.f(["id","107","judul","Pantai Blebak","memo","Pantai lain di Jepara yang tak boleh kamu lewatkan adalah Pantai Blebak. Daya tarik utama pantai ini tampak pada pecahan batu karang yang ada di pesisir pantai. Bahkan, kamu bisa melihat jejeran batu karang yang seolah berbentuk seperti jembatan di tengah laut. Kamu tentu aman bermain di kawasan ini mengingat ombak Pantai Blebak cukup tenang.","tglposting","18 Juni 2019 - Pukul 14:31","urlphoto","https://1.bp.blogspot.com/-OCXEtYuktfE/XSf7UnEXS5I/AAAAAAAAYMo/NFVqSvzCwos-bidHrNfoHqG-qYurmsIygCLcBGAs/s1600/img_posting_20190712_007.jpg","isrejected","0",t,"Ayang Cita Sari","author_urlphoto","https://scontent-sin6-2.cdninstagram.com/vp/a74ad88e1a1d08e92a50c438d7d2ae37/5DA4357B/t51.2885-19/s150x150/65557014_492641148137975_1670975868530327552_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=111"],s,s),P.f(["id","108","judul","Pantai Pailus","memo","Jika mencari pantai di Jepara yang suasananya masih alami dan tak terlalu ramai, kamu bisa datang ke Pantai Pailus. Lokasinya berada di Desa Karanggondang, Mlonggo. Tidak seperti kebanyakan pantai lain di Jepara, pantai ini tidak ramai akan kios atau warung kuliner. Suasananya cenderung sepi, sehingga cocok bagi kamu yang ingin fokus merilekskan diri dan kabur sejenak dari kesibukan sehari-hari. Agar tetap nyaman selama berkunjung, siapkanlah perbekalan secukupnya.","tglposting","18 Juni 2019 - Pukul 14:32","urlphoto","https://1.bp.blogspot.com/-LuQMHvneHkA/XSf7jVLvvlI/AAAAAAAAYMs/Hiqho5sJbBYHjUIRCJXTwx_LgOXMUX9SgCLcBGAs/s1600/img_posting_20190712_008.jpg","isrejected","0",t,"Halo Jepara","author_urlphoto","https://scontent-sin6-2.cdninstagram.com/vp/6c73f4a8700624fe44033e1828919d6d/5DA5FC32/t51.2885-19/s150x150/20635338_1911645825740305_2900902992838393856_a.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=101"],s,s),P.f(["id","109","judul","Karimunjawa","memo","Kamu pasti sudah tidak asing lagi dengan pantai satu ini. Bagaimana tidak? Karimunjawa menjadi salah satu pantai paling populer di Jepara. Keindahan pemandangannya sudah diakui oleh para wisatawan. Berbagai aktivitas air pun bisa kamu lakukan, seperti snorkeling, diving, atau berwisata keliling pulau sekitar dengan menyewa perahu.","tglposting","18 Juni 2019 - Pukul 14:33","urlphoto","https://1.bp.blogspot.com/-hqN6vrRSyxI/XSf72ktErHI/AAAAAAAAYM0/KTJm5fj3DOIcasOgVlduzIvOvWoEUYbQQCLcBGAs/s1600/img_posting_20190712_009.jpg","isrejected","0",t,"Karimun Jawa Island","author_urlphoto","https://scontent-sin6-2.cdninstagram.com/vp/6517f28f7d345240a8d07ff83c8b8631/5DAC72F1/t51.2885-19/11856657_1477467669238628_630612387_a.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=108"],s,s)],[[P.N,P.q,P.q]])],s,P.P)}()
